1 Week ago-

&#34;If you&#39;re considering upgrading from DDR4 to DDR5 in anticipation of a future PC build, you might want to pull the trigger soon. According to a new report from Taiwan, memory maker SK Hynix is preparing to increase the cost of DRAM, which could result in a price increase for DDR5 by up to 20% in the coming quarters. If you were planning on upgrading to AMD&#39;s Zen 5 or Intel&#39;s upcoming Arrow Lake CPUs, it could impact your PC budget.

Word of SK Hynix&#39;s plans comes from the Taiwan Economic Daily&#34;
